import React from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';

import { BrowserRouter, Route, Switch, Redirect, useHistory } from "react-router-dom";
import logo from './logo.svg';
import { Button } from 'antd';
import './App.css';
import YourRequests from './components/YourRequests/YourRequests';

const { Header, Content, Footer } = Layout;

const DashboardLayout = (props) => {
    return (
        <Layout className="layout">
            <Header>
                <div className="logo" />
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                    <Menu.Item key="1">Home</Menu.Item>
                    <Menu.Item key="2">Tasks</Menu.Item>
                    <Menu.Item key="3">Requests</Menu.Item>
                    <Menu.Item key="4">Additional Resources</Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                <Breadcrumb style={{ margin: '16px 0' }}>
                    <Breadcrumb.Item>Home</Breadcrumb.Item>
                    <Breadcrumb.Item>List</Breadcrumb.Item>
                    <Breadcrumb.Item>App</Breadcrumb.Item>
                </Breadcrumb>
                <div className="site-layout-content">Content</div>
                <BrowserRouter>
                    <Switch>
\                        <Route exact path="/yourrequests" component={YourRequests} />

                    </Switch>
                </BrowserRouter>
            </Content>
            <Footer style={{ textAlign: 'center' }}>Ant Design Â©2018 Created by Ant UED</Footer>
        </Layout>
        // mountNode,
    )
}

export default DashboardLayout;
